import {Button} from '@material-ui/core';
import MenuBar from "./Components/Layout/header";

const App = () => {
  return (
    <div align="center">
      <div style = {{backgroundColor:"red", }}>
      <MenuBar/>
      </div>
      <h1>Lets get started with React</h1>
    </div>
  );
}

export default App;
